    false,nt"url": null,nt"notes": "The references cited in this report leave
    no doubt that sea otter fur was commonly used for clothing by all Alaskan natives
    who lived in contact with populations of the animals. It was most commonly used
    for women's clothing and for sleeping robes. Only one direct reference (Veniaminov)
    suggests use of the animal for food, but most refer to the use of "sea-animals"
    as food with-out specifically naming sea otters.",nt"license_title": "License
